import React, { Component } from 'react';
import './App.css';
import { Icon, Input } from 'semantic-ui-react'


class App extends Component {
  render() {
    return (
      <div className="App">
    <Input iconPosition='left' placeholder='Email'>
      <Icon name='at' />
      <input />
    </Input>
      </div>
    );
  }
}

export default App;
